INSERT INTO `tbl_jobs` (`job_id`, `title`, `city`, `country`, `category`, `type`, `experience`, `description`, `responsibility`, `requirements`, `company`, `date_posted`, `closing_date`, `enc_id`) VALUES
('2436268822', 'Software Engineer', 'Bangalore', 'India', 'Information Technology', 'Full-time', '3 Years', 'CodeCraft Innovations is seeking a highly skilled and motivated Software Engineer to join our dynamic team in Bangalore. The successful candidate will play a key role in developing cutting-edge software solutions for our clients.<br>', '<ul><li>Collaborate with cross-functional teams to design, develop, and deploy software applications.</li><li><small></small>Write clean, efficient, and maintainable code using best practices.</li><li>Participate in code reviews and provide constructive feedback to team members.</li><li>Troubleshoot and debug software issues in a timely manner.Stay updated on emerging technologies and trends in software development.</li></ul>', '<ol><li><small>Bachelor\'s degree in Computer Science, Engineering, or related field.</small></li><li><small>2-5 years of experience in software development.</small></li><li><small>Proficiency in programming languages such as Python, Java, or C++.</small></li><li><small>Experience with web development frameworks (e.g., Django, Spring).</small></li><li><small>Strong understanding of data structures, algorithms, and object-oriented design principles.</small></li><li><small>Excellent problem-solving and communication skills.</small></li><li><small>Ability to work independently and as apart of a team in a fast paced-environment.</small></li></ol>Note: Only shortlisted candidates will be contacted for interviews.', 'CM132157171', 'March 02, 2024', '31/03/2024', 12),
('8238914732', 'Data Scientist', 'Mumbai', 'India', 'Information Technology', 'Full-time', '5 Years', 'CodeCraft Innovations is looking for a talented and experienced Data Scientist to join our team in Mumbai on a contract basis. The ideal candidate will be passionate about leveraging data to drive business insights and decision-making.<br>', '<ul><li>Develop predictive models and machine learning algorithms to solve complex business problems.</li><li>Analyze large datasets to extract actionable insights and patterns.</li><li>Collaborate with cross-functional teams to design and implement data-driven solutions.</li><li>Conduct exploratory data analysis and statistical modeling to uncover hidden trends.</li><li>Communicate findings and recommendations to stakeholders through clear and compelling visualizations and presentations.</li></ul>', '<ul><li>Master\'s or Ph.D. degree in Computer Science, Statistics, Mathematics, or related field.</li><li>3-7 years of experience in data science and machine learning.</li><li>Proficiency in programming languages such as Python or R.</li><li>Hands-on experience with data manipulation and analysis libraries (e.g., Pandas, NumPy).</li><li>Strong understanding of statistical concepts and techniques.</li><li>Experience with machine learning frameworks (e.g., TensorFlow, scikit-learn).</li><li>Excellent problem-solving, analytical, and communication skills.</li></ul>', 'CM132157171', 'March 02, 2024', '15/04/2024', 13),
('0571012791', 'Freelance Web Developer', 'Bangalore', 'India', 'Information Technology', 'Freelance', '2 Years', 'CodeCraft Innovations is seeking a talented Freelance Web Developer to work remotely on various exciting projects. The ideal candidate will have a passion for creating innovative and user-friendly web experiences.<br>', '<ul><li>Develop responsive and user-friendly websites based on client requirements.</li><li>Collaborate with the design team to implement UI/UX designs effectively.</li><li>Ensure websites are optimized for performance, speed, and SEO best practices.</li><li>Debug and troubleshoot issues to ensure smooth website functionality across different browsers and devices.</li><li>Keep up-to-date with industry trends and best practices in web development.</li></ul>', '<ul><li>Bachelor\'s degree in Computer Science, Information Technology, or related field.</li><li>2-5 years of experience in web development.</li><li>Proficiency in front-end technologies such as HTML5, CSS3, JavaScript, and jQuery.</li><li>Experience with modern front-end frameworks/libraries (e.g., React, Angular, Vue.js).</li><li>Strong understanding of responsive design principles and cross-browser compatibility.</li><li>Experience with version control systems (e.g., Git).</li><li>Ability to work independently and meet project deadlines.</li><li>Excellent communication and collaboration skills.</li><p>Note: This is a freelance position with flexible working hours and remote work opportunities.</p></ul>', 'CM132157171', 'March 02, 2024', '30/06/024', 16),
('7923939847', 'Digital Marketing Specialist', 'Bangalore', 'India', 'Marketing, Advertising and Branding', 'Full-time', '4 Years', 'TechNest Solutions is looking for a talented Digital Marketing Specialist to drive our digital marketing efforts and help us achieve our business goals. In this role, you will be responsible for developing and implementing digital marketing strategies, managing online campaigns, and analyzing performance metrics to optimize results. You will work closely with our marketing team to enhance brand awareness, generate leads, and engage with our target audience across various digital channels.<br>', '<ul><li>Develop and execute digital marketing campaigns across multiple channels, including email, social media, PPC, SEO, and content marketing.</li><li>Monitor and analyze campaign performance metrics, identify trends, and provide actionable insights to improve campaign effectiveness and ROI.</li><li>Manage social media accounts, create engaging content, and interact with followers to build brand loyalty and increase engagement.</li><li>Conduct keyword research, optimize website content, and implement on-page and off-page SEO strategies to improve search engine rankings and drive organic traffic.</li><li>Collaborate with internal teams and external partners to create compelling marketing collateral, including landing pages, blog posts, infographics, videos, and ads.</li></ul>', '<ul><li>Bachelor\'s degree in Marketing, Communications, or a related field.</li><li>Proven experience in digital marketing roles with a focus on strategy development, campaign management, and performance analysis.</li><li>In-depth knowledge of digital marketing tools, platforms, and techniques (Google Analytics, Google Ads, Facebook Ads, SEO tools, etc.).</li><li>Strong analytical skills and ability to interpret data to make informed decisions and optimize campaigns.</li><li>Excellent written and verbal communication skills, with a creative mindset and attention to detail.</li><li>Ability to multitask, prioritize tasks, and work effectively in a fast-paced environment.</li></ul>', 'CM298776905', 'March 02, 2024', '27/05/2024', 17),
('6818815147', 'Content Writer ', 'Bangalore', 'India', 'Creative Design and Multimedia', 'Part-time', '2 Years', 'TechNest Solutions is seeking a skilled and passionate Content Writer to join our team on a part-time basis. As a Content Writer, you will be responsible for creating engaging and informative content for our website, blog, social media channels, and marketing materials. You will collaborate closely with our marketing and design teams to develop content strategies, generate ideas, and produce high-quality written content that resonates with our target audience.<br>', '<ul><li>Research and write original content on various topics related to technology, software development, digital marketing, and entrepreneurship.</li><li>Produce compelling blog posts, articles, whitepapers, case studies, and other written materials to support our marketing initiatives and drive engagement.</li><li>Optimize content for search engines (SEO) and ensure it aligns with our brand voice, style guidelines, and messaging objectives.</li><li>Edit and proofread content to ensure accuracy, clarity, and consistency in grammar, spelling, and punctuation.</li><li>Stay up-to-date with industry trends, best practices, and emerging technologies to maintain relevance and freshness in our content.</li></ul>', '<ul><li>Bachelor\'s degree in English, Journalism, Communications, or a related field.</li><li>Proven experience as a Content Writer, Copywriter, or similar role, with a strong portfolio of published writing samples.</li><li>Excellent writing and editing skills, with the ability to craft clear, concise, and compelling content for different audiences and formats.</li><li>Understanding of SEO principles and content optimization techniques.</li><li>Proficiency in content management systems (e.g., WordPress) and familiarity with social media platforms.</li><li>Strong research skills and ability to gather information from multiple sources to develop accurate and authoritative content.</li><li>Attention to detail, creativity, and a passion for storytelling.</li></ul>', 'CM298776905', 'March 02, 2024', '12/04/2024', 18),
('7803549711', 'Marketing Assistant', 'Mumbai', 'India', 'Marketing, Advertising and Branding', 'Part-time', 'Fresher', 'We are seeking a dynamic and enthusiastic individual to join our marketing team as a part-time marketing assistant. Responsibilities include assisting with social media management, content creation, market research, and administrative tasks. This position offers flexible hours and is ideal for students or individuals looking for part-time work experience in marketing.<br>', '<ul><li>Assist with social media management, including content scheduling and engagement monitoring.</li><li>Support the marketing team in creating marketing materials such as blog posts, newsletters, and promotional content.</li><li>Conduct market research and analyze industry trends to identify marketing opportunities.</li><li>Provide administrative support to the marketing department as needed.</li></ul>', '<ul><li>Strong communication and writing skills.</li><li>Basic knowledge of digital marketing platforms and tools.</li><li>Ability to work independently and collaboratively in a fast-paced environment.</li><li>Currently enrolled in or recently completed a degree program in marketing or a related field.</li></ul>', 'CM996814410', 'March 02, 2024', '30/03/2024', 19),
('4996428275', 'Graphic Designer', 'Mumbai', 'India', 'Creative Design and Multimedia', 'Part-time', '5 Years', 'We are looking for a creative and talented graphic designer to join our team on a part-time basis. The ideal candidate will have experience in graphic design, with proficiency in Adobe Creative Suite and a strong portfolio showcasing their work. This position offers flexible hours and is perfect for individuals seeking part-time work while pursuing their design career.<br>', '<ul><li>Design engaging and visually appealing marketing materials, including social media graphics, advertisements, and print collateral.</li><li>Collaborate with the marketing team to brainstorm and develop creative concepts for various projects.</li><li>Ensure brand consistency across all design assets.</li><li>Manage multiple design projects simultaneously and meet deadlines.</li></ul>', '<ul><li>Proficiency in Adobe Creative Suite (Photoshop, Illustrator, InDesign).</li><li>Strong design portfolio demonstrating creativity and technical skills.</li><li>Excellent communication and collaboration skills.</li><li>Ability to work independently and efficiently in a remote setting.</li></ul>', 'CM996814410', 'March 02, 2024', '23/05/2024', 20),
('6898431222', 'Content Writer', 'Remote', 'India', 'Creative Design and Multimedia', 'Freelance', '5 Years', 'We are seeking experienced freelance content writers to contribute high-quality content for various marketing campaigns and projects. The ideal candidate will have a proven track record of producing engaging and SEO-friendly content across different formats, including blog posts, articles, and website copy. This is a remote position with flexible working hours.<br>', '<ul><li>Research and write compelling and informative content tailored to target audiences.</li><li>Collaborate with the marketing team to develop content strategies and topics.</li><li>Optimize content for search engines and incorporate relevant keywords and SEO best practices.</li><li>Ensure content accuracy, consistency, and adherence to brand guidelines.</li></ul>', '<ul><li>Proven experience as a content writer or copywriter, with a strong portfolio of published work.</li><li>Excellent writing, editing, and proofreading skills.</li><li>Understanding of SEO principles and keyword research tools.</li><li>Ability to meet deadlines and work independently in a remote environment.</li></ul>', 'CM996814410', 'March 02, 2024', '07/06/2024', 21);
